import React from 'react';
import MainLayout from '../layout/MainLayout';

function LoginPage() {
  return (
    <MainLayout>
        <div className="mx-auto max-w-lg bg-white mt-8 rounded p-7">
          <h3 className="text-center text-grey-700 font-bold text-3xl">Login</h3>
          <div>
            <form action="">
              <div>
                <label className="text-slate-400" htmlFor="">Email</label>
                <input type="text" className="rounded w-full px-3 h-12 space-y-5" />
              </div>
            </form>
          </div>
        </div>
    </MainLayout>
  );
}

export default LoginPage;
